public class Solution
{
    public int FindCircleNum(int[][] isConnected)
    {
        HashSet<int> provinces = new HashSet<int>();
        int n = isConnected.Length;
        int countProvinces = 0;
        for(int i=0; i < n; i++) 
            provinces.Add(i);   
        Stack<int> province = new Stack<int>();
        int provinceNow;
        while (provinces.Count != 0) 
        {
            if (province.Count == 0)
                province.Push(provinces.First()); 
            while (province.Count != 0) 
            {
                provinceNow = province.Pop();
                provinces.Remove(provinceNow);
                isConnected[provinceNow][provinceNow] = 0;
                for (int i = 0; i < n; i++)
                {
                    if (isConnected[provinceNow][i] == 1 && isConnected[i][i] == 1)
                    {
                        isConnected[i][provinceNow] = 0;
                        isConnected[i][i] = 0;
                        province.Push(i);
                    }
                }
            }
            countProvinces++;
        }
        return countProvinces;
    }
}